import React from "react";
import {ListGroup} from "react-bootstrap";

export default function SportsEvent(){
    const events = [
        { id: 1, name: "Rise of Champions",Date:"12/02/2022",price: 38.02},
        { id: 2, name: "Bicycle Maintenance Class- 99 Bikes Manukau course 2",Date:["2022/12/02","2022/03/03"],price: 0},
        { id: 3, name: "Ordinarycoders course 3", price: 103 },
        { id: 4, name: "Ordinarycoders course 4", price: 104 },
        { id: 5, name: "Ordinarycoders course 5", price: 105 }
    ];
    return(
        <div>
            <ListGroup>
                <ListGroup.Item action href="#link1">
                    Link 1
                </ListGroup.Item>
                <ListGroup.Item action href="#link2" disabled>
                    Link 2
                </ListGroup.Item>
                <ListGroup.Item action>
                    This one is a button
                </ListGroup.Item>
            </ListGroup>,
        </div>
    )
}
